-- Adatbázis létrehozása
CREATE SCHEMA `healthylifestyle` DEFAULT CHARACTER SET utf8 COLLATE utf8_hungarian_ci ;

-- Táblák létrehozása
CREATE TABLE `healthylifestyle`.`diet_types` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NULL,
  PRIMARY KEY (`id`));
  
CREATE TABLE `healthylifestyle`.`User_diet` (
  `user_id` INT NULL,
  `diet_id` INT NULL);

  CREATE TABLE `healthylifestyle`.`User_data` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `first_name` VARCHAR(45) NULL,
  `last_name` VARCHAR(45) NULL,
  `email` VARCHAR(50) NULL,
  `gender` VARCHAR(45) NULL,
  `height_cm` INT NULL,
  `weight_kg` INT NULL,
  PRIMARY KEY (`id`));
  
